import { NgModule } from "@angular/core";
import { Routes } from "@angular/router";
import {RouterModule}from "@angular/router";
import { StudentsListComponent } from "./modules/students/students-list/students-list.component";
import { SingleStudentDetailsComponent } from "./modules/students/single-student-details/single-student-details.component";
import { NotFoundComponent } from "./not-found/not-found.component";
import { HomeComponent } from "./home/home.component";
const APP_ROUTES:Routes=[
    {path:"",redirectTo:"home",pathMatch:"full"},
    {path:"home",component:HomeComponent},
    {path:"students",component:StudentsListComponent},
    {path:"students/",component:StudentsListComponent},
    {path:"studentDetails",component:SingleStudentDetailsComponent},
    {path:"**",component:NotFoundComponent}
];
@NgModule({
imports:[RouterModule.forRoot(APP_ROUTES)],
exports:[RouterModule]
})
export class AppRoutingModule{

}
